import React from 'react';
import styles from "./Header.module.scss";
import {NavLink} from "react-router-dom";
import {ADD_ROPES_IN_STOCK_PAGE, ROPES_IN_STOCK_PAGE} from "../../routes/const";

const Header = () => {
    return (
        <div>
            <div className={styles.header}>
                <NavLink className={styles.links} to={ADD_ROPES_IN_STOCK_PAGE}>Add ropes in stock</NavLink>
                <NavLink className={styles.links} to={ROPES_IN_STOCK_PAGE}>Ropes in stock</NavLink>
                <div>order3</div>
                <div>order4</div>
            </div>
        </div>
    );
};

export default Header;
